content.css:
.rotateLeft {
  vertical-align: middle;
  text-align: center;
}
div.sandbox-host {
  width: 100%;
  height: 100%;
}
td span {
  -ms-writing-mode: tb-rl;
  -webkit-writing-mode: vertical-rl;
  writing-mode: vertical-rl;
  transform: rotate(180deg);
  white-space: nowrap;
}
tr.layoutRow {
  height: 0;
}
td.chartArea {
  height: 100%;
}
#masterDiv {
  display: flex;
  justify-content: space-around;
  align-items: center;
}
#masterDiv table {
  border-spacing: 0px;
}
.chartLabel {
  text-align: center;
  width: 100%;
  height: 0;
}
.yLabel {
  width: 0;
  height: 0;
  white-space: no-wrap;
}
hr.license {
  width: 70%;
}
.xLabel {
  width: 100%;
  text-align: center;
}
.datapoint {
  opacity: 1;
  stroke: black;
  stroke-width: 1;
}
.selected {
  opacity: 1;
}
.legendColor {
  stroke: black;
  stroke-width: 1px;
}
.background {
  fill: lightgray;
  opacity: 0.2;
  stroke: black;
  stroke-width: 1px 2px 1x 0;
  stroke-opacity: 1;
}
.yAxis path,
.yAxis line,
.xAxis path,
.xAxis line {
  fill: none;
  stroke: #000;
  stroke-width: 1px;
}
div.nodata {
  margin: auto;
  width: 50%;
  font-size: 22vmin;
  text-align: center;
  color: grey;
  position: relative;
  top: 50%;
  -webkit-transform: translateY(-50%);
  -ms-transform: translateY(-50%);
  transform: translateY(-50%);
}
div.stScatterPlotHeader,
div.stScatterPlotChannel,
div.stScatterPlotMainhelp,
div.stScatterPlotSupport {
  text-align: left;
  width: 500px;
  margin: auto;
  font-family: Georgia, Times, Times New Roman, serif;
}
div.stScatterPlotHeader > h2 {
  text-align: center;
}
div.stScatterPlotHeader > .byline {
  text-align: center;
}
div.stScatterPlotMainhelp > .options {
  font-style: italic;
}
#stScatterPlotIcon {
  display: block;
  width: 200px;
  height: 200px;
  margin-left: auto;
  margin-right: auto;
  background-image: url('data:image/png;base64,');
}


